     &   (4*(F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub597(All5,Cha4,Ind1)*Sub610(All4,All5,Ind3,Ind4)*
     &         Sub611(All4,Cha4,Ind2) + 
     &        2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub618(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

        Sub638(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub597(All5,Cha4,Ind1)*Sub610(All4,All5,Ind3,Ind4)*
     &         Sub611(All4,Cha4,Ind2) + 
     &        2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub618(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

        Sub630(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub597(All5,Cha4,Ind1)*Sub611(All4,Cha4,Ind2)*
     &         Sub622(All4,All5,Ind3,Ind4) + 
     &        2*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub629(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

        Sub639(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (4*(F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &         Sub597(All5,Cha4,Ind1)*Sub611(All4,Cha4,Ind2)*
     &         Sub622(All4,All5,Ind3,Ind4) + 
     &        2*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &         Mf(tH,gno2)*Sub629(All4,All5,Ind1,Ind2)*
     &         UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &         VChaC(Cha4,2)))/S2B**2

        Sub636(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   4*cI*(3*F2*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &        Sub597(All5,Cha4,Ind1)*Sub611(All4,Cha4,Ind2)*
     &        Sub632(All4,All5,Ind3,Ind4) + 
     &       6*CB2*F1*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &        Mf(tH,gno2)*Sub635(All4,All5,Ind1,Ind2)*
     &        UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &        VChaC(Cha4,2))/S2B**2

        Sub641(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   4*cI*(3*F1*SB2*CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &        Sub597(All5,Cha4,Ind1)*Sub611(All4,Cha4,Ind2)*
     &        Sub632(All4,All5,Ind3,Ind4) + 
     &       6*CB2*F2*CKM(gno1,Ind3)*CKMC(gno2,Ind4)*Mf(tH,gno1)*
     &        Mf(tH,gno2)*Sub635(All4,All5,Ind1,Ind2)*
     &        UASf(All5,Ind4,bH)*UASfC(All4,Ind3,bH)*VCha(Cha4,2)*
     &        VChaC(Cha4,2))/S2B**2

        Sub631(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub619(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub630(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub640(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   Sub638(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,1,uzext1) - 
     &    Sub639(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)*
     &     XHiggs(hno,2,uzext1)

        Sub637(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (Sub631(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CB*CW*Sub636(All4,All5,Cha4,Ind1,Ind2,Ind3,
     &        Ind4)*XHiggs(hno,3,uzext1))/(CB*CW)

        Sub642(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   (Sub640(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &      CB*CW*Sub641(All4,All5,Cha4,Ind1,Ind2,Ind3,
     &        Ind4)*XHiggs(hno,3,uzext1))/(CB*CW)

        Sub643(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) = 
     &   m2*pave16(PVC(cc1),All4,All5,Cha4)*
     &     Sub637(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4) + 
     &    m3*pave16(PVC(cc2),All4,All5,Cha4)*
     &     Sub642(All4,All5,Cha4,Ind1,Ind2,Ind3,Ind4)

	ENDLOOP(All4)
	ENDLOOP(All5)
	ENDLOOP(Cha4)
	ENDLOOP(Ind1)
	ENDLOOP(Ind2)
	ENDLOOP(Ind3)
	ENDLOOP(Ind4)

	end
